import React from "react";
function FeedbackItem({item}){
    return(
        <div className="card">
        <span className=" position-absolute top-0 start-0 translate-middle
         badge rounded-pill bg-secondary ">
         {item.rating}
         </span>
        <div className="card-body">
        {item.text}
        <button >Color</button>
        </div>
            
        </div>
    )
}
export default FeedbackItem;
